INSERT INTO `stuanalysis` VALUES ('U201714522', '万瑞萍', 1, 31, NULL, '19', 'CS1701_A31是在头脑中把事物或对象由整体分解成各个部分或属性。 尽管“分析”作为一个正式的概念在近年来才逐步建立起来，这一技巧自亚里士多德（公元前384年至322年）就已经应用在了数学、逻辑学等多个领域。是在头脑中把事物或对象由整体分解成各个部分或属性。 尽管“分析”作为一个正式的概念在近年来才逐步建立起来，这一技巧自亚里士多德（公元前384年至322年）就已经应用在了数学、逻辑学等多个领域。是在头脑中把事物或对象由整体分解成各个部分或属性。 尽管“分析”作为一个正式的概念在近年来才逐步建立起来，这一技巧自亚里士多德（公元前384年至322年）就已经应用在了数学、逻辑学等多个领域。', NULL, NULL);
INSERT INTO `stuanalysis` VALUES ('U201714524', '王宝强', 2, 31, NULL, '19', 'CS1701_A31议伊始，由班长崔旭东总结近期班级学习情况，并建议大家合理安排学习时间，希望大家在后期考试中取得好成绩。随后，班助李艳静就保研、专业课和英语学习、社团和学生工作三个方面进行分享，她提到：“只要大家端正态度，用心学习，就不会在学业方面存在很大问题”。接下来，孟竹为大家进行学习经验分享，她认为早睡早起的生活习惯，注重课堂效率和学会结伴学习这三个方面十分重要。接着，班导师王晓娟就李艳静和孟竹的发言分享自己作为一名专业课老师的感受，并希望同学们能够在学习上有主动性，去自我推动完成学业和创新实验等事务。接着，四名成长共进小组组长发言，总结各小组组员近期学习生活情况，存在的问题及制定的学习目标。最后，辅导员耿旭超对此次会议做出总结，希望同学们能团结一心，积极沟通交流，在学习上互相帮助。', NULL, NULL);
