INSERT INTO `stuanalysis` VALUES ('U201714867', '张荣华', 2, 11, NULL, 'CS1802', 'ACM1701_A11议伊始，由班长崔旭东总结近期班级学习情况，并建议大家合理安排学习时间，希望大家在后期考试中取得好成绩。随后，班助李艳静就保研、专业课和英语学习、社团和学生工作三个方面进行分享，她提到：“只要大家端正态度，用心学习，就不会在学业方面存在很大问题”。接下来，孟竹为大家进行学习经验分享，她认为早睡早起的生活习惯，注重课堂效率和学会结伴学习这三个方面十分重要。接着，班导师王晓娟就李艳静和孟竹的发言分享自己作为一名专业课老师的感受，并希望同学们能够在学习上有主动性，去自我推动完成学业和创新实验等事务。接着，四名成长共进小组组长发言，总结各小组组员近期学习生活情况，存在的问题及制定的学习目标。最后，辅导员耿旭超对此次会议做出总结，希望同学们能团结一心，积极沟通交流，在学习上互相帮助。', NULL, NULL);
